import React, { Component } from "react";
import "./ImagePortal.css";

export default class ImagePortal extends Component {
  render() {
    return (
      <div className="Home">
        <div className="lander">
          <h1>The Runway</h1>
          <p>This page is the Image Portal, where all the images will be displayed</p>
        </div>
      </div>
    );
  }
}
